tables.table_schema:
CREATE TABLE retirement_accounts (
	ra_id UUID PRIMARY KEY,
	account_holder_name STRING,
	account_balance DECIMAL,
	age INT
);

CREATE TABLE distribution_calculations (
	dc_id UUID PRIMARY KEY,
	ra_id UUID REFERENCES retirement_accounts(ra_id),
	required_min_distribution DECIMAL,
	calculation_date DATE
);

CREATE TABLE retirement_account (account_id INT PRIMARY KEY, account_owner VARCHAR(255), account_balance DECIMAL, account_age INT);

CREATE TABLE distribution_rules (rule_id INT PRIMARY KEY, age_threshold INT, distribution_percentage DECIMAL);

CREATE TABLE distribution_events (event_id INT PRIMARY KEY, account_id INT, event_date DATE, distribution_amount DECIMAL);

CREATE TABLE required_min_distributions (
  account_id INT PRIMARY KEY,
  age INT,
  distribution_amount DECIMAL
);

CREATE TABLE account_owners (
  owner_id INT PRIMARY KEY,
  owner_name VARCHAR(100),
  account_id INT
);

CREATE TABLE beneficiaries (
  beneficiary_id INT PRIMARY KEY,
  beneficiary_name VARCHAR(100),
  account_id INT
);

CREATE TABLE account_balances (
  account_id INT PRIMARY KEY,
  balance DECIMAL
);

CREATE TABLE distribution_history (
  distribution_id INT PRIMARY KEY,
  account_id INT,
  distribution_date DATE,
  amount_distributed DECIMAL
);
